import React, { useState } from 'react';
import './home.css';
import Header from './header.js';
import image1 from './assets/partner1.jpg'; // replace with your actual image path
import image2 from './assets/partner2.jpg'; // replace with your actual image path
import Drawer from './drawer'; // Make sure to import the Drawer component

const Home = () => {
    const [isDrawerOpen, setDrawerOpen] = useState(false);

    const toggleDrawer = () => {
        setDrawerOpen(!isDrawerOpen);
    };

    return (
        <div className="homepage">
            <div className='header-div'>
                <Header toggleDrawer={toggleDrawer} />
            </div>
            <Drawer isOpen={isDrawerOpen} toggleDrawer={toggleDrawer} />
            {!isDrawerOpen && (
                <div className="content">
                    <h1>Our Partners</h1>
                    <div className="tiles-container">
                        <div className="tile">
                            <img src={image1} alt="Partner 1" />
                        </div>
                        <div className="tile">
                            <img src={image2} alt="Partner 2" />
                        </div>
                    </div>
                    <div className='number'>
                        <h2>Call Us</h2>
                        <span>9633220088</span>
                    </div>
                </div>
            )}
        </div>
    );
};

export default Home;
